INSERT INTO `historico` (`cd_historico`, `ds_prompt`, `nm_titulo`, `ds_resposta`, `im_resposta`, `ds_resposta_elaborada`, `nm_tag01`, `nm_tag02`, `nm_tag03`, `nm_tag04`, `nm_tag05`, `nm_tag06`, `nm_tag07`, `nm_tag08`, `nm_tag09`, `nm_tag10`, `cd_usuario`, `dt_gerado`, `dt_alterado`) VALUES
(23, 'vampiros sexy', '\"Bloodlust: Seduction of the Night\"', 'O jogo se passa em uma cidade sombria e misteriosa, onde os vampiros mais sedutores e poderosos do mundo habitam. O jogador assume o papel de um jovem caçador de vampiros, que é recrutado por uma organização secreta para eliminar a ameaça dos vampiros sedutores que estão aterrorizando a cidade.\r\n\r\nAo longo do jogo, o jogador terá que enfrentar desafios emocionantes e perigosos, como batalhas épicas contra os vampiros mais poderosos, resolver enigmas complexos e descobrir segredos sombrios sobre a origem dos vampiros.\r\n\r\nAlém disso, o jogador terá a oportunidade de interagir com diversos personagens cativantes, incluindo outros caçadores de vampiros, humanos inocentes em perigo e até mesmo alguns vampiros que podem não ser tão maus quanto parecem.\r\n\r\nCom gráficos impressionantes, uma trilha sonora envolvente e uma história cheia de reviravoltas inesperadas, este jogo promete levar os jogadores a um mundo de fantasia sombria e sensual, onde nada é o que parece e o perigo espreita em cada esquina. Será você capaz de sobreviver neste mundo de vampiros sexy?', '', '', '', '', '', '', '', '', '', '', '', '', 13, '2024-11-10', '2024-11-10'),
(24, 'batman\r\n', '\"Batman: O Cavaleiro das Trevas Renasce\"', 'Em um mundo pós-apocalíptico dominado pelo caos e pela destruição, a cidade de Gotham encontra-se à beira do colapso total. Os cidadãos estão desesperados por ajuda, e é nesse momento que Batman e seus aliados decidem intervir.\r\n\r\nJuntos, eles planejam uma defesa de torres de vídeo-game para proteger a cidade dos inimigos que se aproximam. Com a tecnologia cyberpunk ao seu dispor, eles constroem torres de defesa equipadas com armas avançadas e dispositivos de alta tecnologia.\r\n\r\nOs jogadores assumem o papel dos heróis da cidade, cada um com habilidades únicas e especiais que podem ser usadas para derrotar os inimigos. Eles devem trabalhar em equipe para coordenar suas estratégias e garantir a sobrevivência da cidade.\r\n\r\nEnquanto lutam contra hordas de inimigos apocalípticos, os jogadores também enfrentam desafios fantásticos e criaturas místicas que surgem das sombras da noite. A batalha final se aproxima, e apenas com trabalho em equipe e determinação eles poderão salvar Gotham do destino sombrio que a aguarda.', '', '', 'Apocalíptico', 'Casual', 'Co-op', 'Esporte', 'Fantasia', 'Apocalíptico', 'Cyberpunk', 'Defesa de Torres', '', '', 13, '2024-11-10', '2024-11-10');
INSERT INTO `historico` (`cd_historico`, `ds_prompt`, `nm_titulo`, `ds_resposta`, `im_resposta`, `ds_resposta_elaborada`, `nm_tag01`, `nm_tag02`, `nm_tag03`, `nm_tag04`, `nm_tag05`, `nm_tag06`, `nm_tag07`, `nm_tag08`, `nm_tag09`, `nm_tag10`, `cd_usuario`, `dt_gerado`, `dt_alterado`) VALUES
(25, 'golf\r\n', '\"Fairway Frenzy: O Desafio do Campo de Golfe\"', 'O jogador assume o papel de um jovem golfista talentoso que sonha em se tornar o campeão do torneio de golfe mais prestigiado do mundo. Para alcançar seu objetivo, ele deve viajar por diferentes campos de golfe desafiadores, enfrentando diversos obstáculos naturais e artificiais ao longo do caminho.\r\n\r\nAlém de aprimorar suas habilidades de golfe, o jogador também terá que resolver quebra-cabeças e desafios ambientais para avançar no jogo. Em cada campo, ele encontrará personagens interessantes que podem ajudá-lo ou atrapalhá-lo em sua jornada.\r\n\r\nConforme o jogador progride, ele descobre segredos ocultos sobre o torneio e seus competidores, levando a reviravoltas inesperadas na história. No final, ele enfrenta o atual campeão em um confronto épico para determinar quem é o verdadeiro mestre do golfe.\r\n\r\nCom gráficos impressionantes, jogabilidade envolvente e uma narrativa cativante, este jogo de aventura de golfe oferece uma experiência única e emocionante para os fãs do esporte e jogadores casuais. Será que o jogador tem o que é preciso para superar todos os desafios e se tornar o novo campeão?', '', '', 'Aventura', '', '', '', '', '', '', '', '', '', 13, '2024-11-10', '2024-11-10'),
(26, 'acrobacias mortais', '\"Acrobacias Mortais: Desafio Extremo\"', 'O jogo Battle Royale de acrobacias mortais se passa em um mundo futurista distópico, onde os competidores são desafiados a lutar pela sobrevivência em uma arena virtual repleta de obstáculos e perigos. Cada jogador controla um personagem ágil e habilidoso, capaz de realizar acrobacias incríveis e manobras mortais para eliminar seus adversários.\r\n\r\nOs competidores devem usar suas habilidades acrobáticas para se movimentar rapidamente pelo cenário, desviar de armadilhas e ataques inimigos, e encontrar maneiras criativas de eliminar seus oponentes. A cada rodada, a área segura da arena vai diminuindo, forçando os jogadores a se confrontarem em confrontos cada vez mais intensos.\r\n\r\nAlém das acrobacias mortais, os jogadores também podem coletar power-ups e armas especiais espalhadas pelo cenário para aumentar suas chances de sobrevivência. O último jogador ou equipe sobrevivente é declarado o vencedor do jogo, garantindo fama e glória na sociedade distópica do futuro.\r\n\r\nCom gráficos impressionantes, mecânicas de jogo inovadoras e uma jogabilidade frenética, o Battle Royale de acrobacias mortais promete ser uma experiência eletrizante para os fãs de jogos competitivos e adrenalina pura. Prepare-se para entrar na arena e mostrar suas habilidades acrobáticas neste emocionante jogo de sobrevivência!', '', '', 'Battle Royale', 'Esporte', '', '', '', '', '', '', '', '', 26, '2024-11-10', '2024-11-10');
